      release = function() {};
  }
  if (!snapping) {
      snapping = function() {
          return true;
      }
  }
  if (!rearrange) {
      rearrange = function() {
          return false;
      }
  }
  if (!spacing_x) {
      spacing_x = 20;
  }
  if (!spacing_y) {
      spacing_y = 80;
  }
