    if(e.target.closest(".blockelem") !== null) {
      document.getElementById("properties").classList.add("expanded");
      document.getElementById("propwrap").classList.add("itson");
    }
  }
  return (
    <div >
     <Header />
     <Sidenav />
     <Properties />
     <div id="canvas" onClick={(e) => handleCanvas(e)}></div>
    </div>
  );
}

export default App;
